import React, { useState } from 'react';

function SearchBar() {
  const [search, setSearch] = useState('');

  const onChange=(e)=>{
    setSearch(e.target.value);
  }
  return (
    <div className="search-bar">
      <input
        type="text"
        className="search-barInput"
        placeholder="Search by username"
        onChange={onChange}
      />
    </div>
  );
}

export default SearchBar;
